function CandidateRow(props) {
    return <tr>
        <td>
            {props.candidate.FirstName}{" "}{props.candidate.LastName}
        </td>
        <td>
            {props.candidate.Occupation}
        </td>
        <td>
            {props.candidate.Region}
        </td>       
        <td>
           <center>
             <button className='btn btn-danger'
                onClick={() => {
                    props.viewCandidate(props.candidate.viewCandidate)
                }}>
                View
            </button>
           </center>
        </td>


    </tr>
}
export default CandidateRow;
